" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Palpation of the lateral femoral condyle",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 373px; height: 274px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Palpation of the lateral femoral condyle is performed to assess the integrity of the iliotibial band, a broad, thick fascia that is the distal portion of the tensor fascia lata and the vastus lateralis fascia. It crosses the prominence of the lateral femoral condyle to attach primarily at the proximal tibia and blends with the lateral patellar retinaculum near the lateral joint line. The lateral femoral condyle is palpated 1 inch above the joint line.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Bruce C Anderson, MD.",
"    </div>",
"   </div>",
"  </div>",
