var title_f24_61_25564="Organic psychosis";
var content_f24_61_25564=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F52785&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F52785&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Medical conditions associated with acute psychosis in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Condition",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Substrate deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hypoglycemia*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Cerebral hypoxia*",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        CNS abnormality",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Brain tumor*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Brain abscess*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Intracranial injury (head trauma)*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        CNS infection (meningitis, encephalitis)*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Stroke*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Interictal psychosis",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Temporal lobe epilepsy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Landau Kleffner syndrome",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        SSPE*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Systemic lupus erythematosus",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Metabolic disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Urea cycle defect*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Acute intermittent porphyria*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Wilson disease*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Other",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Electrolyte disturbance*",
"        <sup>",
"         &Delta;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hepatic failure*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Uremia*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Postpartum psychosis*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Hashimoto thyroiditis (Hashimoto encephalopathy)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Thyroid storm*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Antiphospholipid syndrome",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     CNS: central nervous syndrome; SSPE: subacute sclerosing panencephalitis; SLE: systemic lupus erythematosus.",
"     <br>",
"      * Life-threatening.",
"      <br>",
"       <span class=\"bullet\">",
"        &bull;",
"       </span>",
"       Causes of cerebral hypoxia include cardiac insufficiency, pulmonary insufficiency, and severe anemia.",
"       <br>",
"        &Delta; Acute psychosis may be seen with hypocalcemia and hypomagnesemia. Hypo- or hypernatremia may cause encephalopathy with delirium.",
"       </br>",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
